import React, { useState, useEffect } from 'react';
import { FaPlus, FaEdit, FaTrash, FaTree } from 'react-icons/fa';
import PageHeader from '../components/common/PageHeader';
import { parkApi } from '../services/api';

const Parks = () => {
  const [parks, setParks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchParks();
  }, []);

  const fetchParks = async () => {
    try {
      const response = await parkApi.getAll();
      setParks(response.data?.data || []);
    } catch (error) {
      setError('Failed to fetch parks');
      console.error('Error fetching parks:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="loading-spinner" />
      </div>
    );
  }

  if (error) {
    return (
      <div className="p-4">
        <div className="bg-red-50 text-red-700 p-4 rounded-lg">
          {error}
        </div>
      </div>
    );
  }

  return (
    <div>
      <PageHeader
        title="Parks"
        description="Manage your safari park locations"
        actions={
          <button className="btn btn-primary">
            <FaPlus className="h-4 w-4 mr-2" />
            Add Park
          </button>
        }
      />

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {parks.map((park) => (
          <div key={park.id} className="card">
            <div className="relative h-48 bg-gray-200">
              {park.image_url ? (
                <img
                  src={park.image_url}
                  alt={park.name}
                  className="w-full h-full object-cover"
                />
              ) : (
                <div className="flex items-center justify-center h-full">
                  <FaTree className="h-12 w-12 text-gray-400" />
                </div>
              )}
              <div className="absolute top-2 right-2 flex space-x-2">
                <button className="btn btn-sm btn-secondary">
                  <FaEdit className="h-4 w-4" />
                </button>
                <button className="btn btn-sm btn-danger">
                  <FaTrash className="h-4 w-4" />
                </button>
              </div>
            </div>
            <div className="card-body">
              <h3 className="font-semibold text-lg mb-2">{park.name}</h3>
              <p className="text-gray-600 text-sm mb-4">{park.description}</p>
              <div className="flex items-center justify-between">
                <span className="badge badge-info">
                  {park.circuit}
                </span>
                <span className="text-sm text-gray-500">
                  {park.packages_count || 0} Packages
                </span>
              </div>
            </div>
          </div>
        ))}

        {parks.length === 0 && (
          <div className="col-span-full">
            <div className="text-center py-12 bg-white rounded-lg border-2 border-dashed border-gray-300">
              <FaTree className="mx-auto h-12 w-12 text-gray-400" />
              <h3 className="mt-2 text-sm font-medium text-gray-900">No parks</h3>
              <p className="mt-1 text-sm text-gray-500">Get started by creating a new park.</p>
              <div className="mt-6">
                <button className="btn btn-primary">
                  <FaPlus className="h-4 w-4 mr-2" />
                  Add Park
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Parks;
